import AppTable from './AppTable'
import Modal from 'react-bootstrap/Modal'
import Button from '@mui/material/Button';

const AppTableModal = ({show, onHide, features, items}) => {
    return (
        <div>
            <Modal 
                show={show} 
                onHide={onHide}
                style={modalStyle}
                size="sm" 
                centered
                >
                    <Modal.Header>
                        <Modal.Title> File upload example for text classification </Modal.Title>
                    </Modal.Header>
                    <Modal.Body style={{textAlign:'center'}} >

                        <AppTable 
                            features={features}
                            items={items}
                        />


                    </Modal.Body>
                    <Modal.Footer>
                        <Button size="small" variant="secondary" onClick={onHide}>
                            X
                        </Button>
                    </Modal.Footer>
            </Modal>
        </div>
    )
}

const modalStyle = {
    textAlign: 'right',
    padding: "80px",
    fontFamily: 'Calibri light',
    fontSize:'18px'
  };

export default AppTableModal
